export default (state, action) => {
  switch (action.type) {
    case "WITHDRAW_10000":
      return { ...state, payload: action.amount }
    case "WITHDRAW_5000":
      return { ...state, payload: action.amount }
    case "GIVE_ALL_TO_CHARITY":
      return { ...state, payload: action.amount }
    default:
      return state
  }
}
